/* Generated File Run.js in Project name */	function close_name(){	Minimizer.close("name");}	function minimize_name(){	Minimizer.minimize("name");}	function maximize_name(){	Minimizer.maximize("name");}function open_name(){}/* Initialize application */			function init_name(){	$("#body-name").keypress(function(event) {	}).mouseover(function(){	    $("#name-container").draggable({disabled:true});    }).mouseout(function(){        $("#name-container").draggable({disabled:false});    });		$("#name-container").mousedown(function(){		Focus.set("name");		setMenu_name();			fixSizenameSpeed = 0;	})	.mouseup(function(){		fixSizenameSpeed = 300;	});		/* Make application resizable */	Resizable.set("name");		$("#exit-name").mousedown(function(){		close_name();		$("#body-name").val("");	});	$("#maximize-name").mousedown(function(){		maximize_name()	});		$("#minimize-name").mousedown(function(){		minimize_name()	});			fixSize_name();}/* Fix size application */var fixSizenameSpeed = 300;function fixSize_name(){	setTimeout(function(){		if(LoadAppsID["name"].onFocus){			height = $("#name-container").height();			width = $("#name-container").width();			$("#body-name").css({"height" : height-45, "width" : width-5});		}		fixSize_name();	},fixSizenameSpeed);}/* Set application menu */function setMenu_name(){	proIdApps = "name";	var valMenu = "<span id=top-menu-item0 class=top-menu-item>hahaha</span>"+        "<ul id=top-menu-item0-down class=top-menu-item-down>"+            "<li onclick=minimize_name(proIdApps)>Minimize</li>"+			"<li onclick=maximize_name(proIdApps)>Maximize</li>"+			"<li onclick=close_name(proIdApps)>Quit hahaha</li>"+        "</ul>";		$("#top-menu").html(valMenu);		Menu.fixedTopMenu();}/* Register application */function register_name(){	$.post("system/applications/name/layout/name.html", function(data){		ApplicationRun[applicationOpened] = data;		ApplicationRun[applicationOpened] = ApplicationRun[applicationOpened];		$(".program").html(($(".program").html())+ApplicationRun[applicationOpened]);		setTimeout(init_name,100);		fixSize_name();		applicationOpened++;	});	}/* Running application */function run_name(dir, fileName){}